import React, { useState } from 'react';
import API from '../api';
import { useNavigate } from 'react-router-dom';
import '../styles/AddItem.css'; // Import styles
import Navbar from '../components/Navbar';

function AddItem() {
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    size: '',
    condition: '',
    swapType: '',
    washInstructions: '',
    price: '',
  });

  const [imageFile, setImageFile] = useState(null);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleImageUpload = (e) => {
    const file = e.target.files[0];
    if (file) {
      setImageFile(file);
    }
  }

  const handleSubmit = async (e) => {
    e.preventDefault();

    const userId = localStorage.getItem('userId'); // Get logged-in user's ID
    const token = localStorage.getItem('token'); // Get token for authentication

    if (!userId || !token) {
      alert('You must be logged in to add an item.');
      navigate('/login');
      return;
    }

    try {
      const form = new FormData();
      form.append('name', formData.name);
      form.append('description', formData.description);
      form.append('image', imageFile);
      form.append('owner', userId);
      form.append('condition', formData.condition);
      form.append('size', formData.size);
      form.append('swap type', formData.swapType);

      if (formData.status === 'borrow me') {
        form.append('washInstructions', formData.washInstructions);
      }

      if (formData.status === 'buy') {
        form.append('price', formData.price);
      }


      await API.post('/items', form, {
        headers: {
          Authorization: `Bearer ${token}`,
          'Content-Type': 'multipart/form-data',
        },
      });

      alert('Item added successfully!');
      navigate('/items'); // Redirect to item listings
    } catch (error) {
      console.error('Error adding item:', error);
      alert('Failed to add item.');
    }
  };

  return (
    <div className="additem-wrapper">
      <Navbar />

    <div className="add-item-container">
      <h1>contribute to the closet!</h1>
      <form onSubmit={handleSubmit}>
        {/* FILE FIELD */}
        <input
          type="file"
          accept="image/*"
          onChange={handleImageUpload}
          required
        />

        {/* NAME FIELD */}
        <input
          type="text"
          name="name"
          placeholder="Item Name"
          value={formData.name}
          onChange={handleChange}
          required
        />

        {/* DESCRIPTION FIELD */}
        <textarea
          name="description"
          placeholder="Description: size, brand, fit, color, material, etc."
          value={formData.description}
          onChange={handleChange}
          // required
        />

        {/* CONDITION FIELD */}
        <label>Condition:</label>
        <div className="condition-options">
          {['new', 'good', 'poor'].map((c) => (
          <label key={c}>
            <input
              type="radio"
              name="condition"
              value={c}
              checked={formData.condition === c}
              onChange={handleChange}
              // required
            />
            {c}
          </label>
          ))}
        </div>

        {/* size field (optional) */}
        <input
          type="text"
          name="size"
          placeholder="Size (optional)"
          value={formData.size}
          onChange={handleChange}
        />

        {/* SWAP TYPE FIELD */}
        <label>Swap type:</label>
        <select
          name="swapType"
          value={formData.swapType}
          onChange={handleChange}
          // required
          >
          <option value="">Select swap type</option>
          <option value="borrow">Borrow me</option>
          <option value="take">Take me</option>
          <option value="buy">Buy me</option>
        </select>

        {/* CONDITIONAL WASH / PRICE FIELDS */}
        {formData.status === 'borrow' && (
          <input
            type="text"
            name="washInstructions"
            placeholder="Wash Instructions"
            value={formData.washInstructions}
            onChange={handleChange}
            // required
          />
        )}

        {formData.status === 'buy' && (
          <input
            type="number"
            name="price"
            placeholder="Selling Price ($)"
            value={formData.price}
            onChange={handleChange}
            // required
          />
        )}

        {/* SUBMIT BUTTON */}
        <button type="submit">upload to closet</button>
      </form>
    </div>
    </div>
  );
}

export default AddItem;
